import "./ContainerSpanish.css";

const ContainerSpanish = () => {
  return (
    <div className="container-spanish">
      <h1>Hola, hemos notado que hablas español.</h1>
      <p>
        Hemos elegido a los cinco abogados de habla hispana más cercanos a
        usted.
      </p>
    </div>
  );
};

export default ContainerSpanish;
